import "./main.css";
import banner from "../assets/banner-m.jpg";
import lock from "../assets/lock-sm.png";
import React, { useState } from 'react';
import nextPage from "./nextPage";

function Main(props) {
  const [setRend, rend] = useState(false);
  function change(e){
    setRend(true)
  }
  return (
    <main>
      <section className="section1">
        <img src={banner} alt="" />
        <div className="boxes">
          <div className="box">
            <p>1-2 კვირა</p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>5-8 კვირა</p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>
              {" "}
              <img src={lock} alt="" /> 5-8 კვირა
            </p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>
              {" "}
              <img src={lock} alt="" /> 5-8 კვირა
            </p>
            <p>2 000 000₾</p>
          </div>
        </div>
      </section>
      <h2>
        12 კვირის განმავლობაში, მიიღე ფულადი პრიზები ყოველკვირეული საპრიზო
        ფონდიდან
      </h2>
      <div className="dates">
        <button>2.07-29.07</button>
        <button onClick={change}>2.07-29.07</button>
        <button>2.07-29.07</button>
        <button>2.07-29.07</button>
      </div>
      <section className="section2">
      {rend && <nextPage/>}
      </section>
    </main>
  );
}
export default Main;
